import React from "react";
import ReactDOM from "react-dom";
import HOC from "../HOC_1";

class SecondList extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <img src={require('../../assets/2.png')} alt="2.png"/>
      </div>
    );
  }
}

export default HOC(SecondList, "age");
